CREATE TABLE `watches` (
  `sku` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `type` set('watch','chrono') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'watch',
  `status` set('old','current','outlet') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'current',
  `gender` enum('man','woman') COLLATE utf8_unicode_ci NOT NULL,
  `year` int(11) NOT NULL,
  `dial_material` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `dial_color` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `case_material` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `case_form` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bracelet_material` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `movement` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE UNIQUE INDEX sku_index ON watches(sku);


ALTER TABLE `watches`
  ADD PRIMARY KEY (`sku`);
